interface ButtonProps {
    children: React.ReactNode;
}

const BorderButton: React.FC<ButtonProps> = ({children}) => {
    return <>
        <button className='px-6 py-1.5 border rounded-lg  hover:text-orange-500 font-semibold flex'>
            { children }
        </button>
    </>
}

export default BorderButton;
